                     <h1 onClick={()=>{alert("hello");}}>Latest English Songs</h1>
                     <Latest />
                      <div className="b-wrapper">

                      </div>
                 </div>
                 <div className="b-latestB">
                     
                 </div>
            </div>
        </>
    );
}
